(17134,161917,'CDC Surgical Wound Classification: \"An uninfected operative wound in which no inflammation is encountered and the respiratory, alimentary, genital, or uninfected urinary tract is not entered. In addition, clean wounds are primarily closed and, if necessary, drained with closed drainage. Operative incisional wounds that follow nonpenetrating (blunt) trauma should be included in this category if they meet the criteria.\" (CDC 1999)\r\nREF: http://www.cdc.gov/hicpac/SSI/table7-8-9-10-SSI.html','en',1,'2013-07-31 01:11:33',1,'2013-07-31 15:09:05','17134FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(17135,161918,'CDC Surgical Wound Classification: \"An operative wound in which the respiratory, alimentary, genital, or urinary tracts are entered under controlled conditions and without unusual contamination. Specifically, operations involving the biliary tract, appendix, vagina, and oropharynx are included in this category, provided no evidence of infection or major break in technique is encountered.\" (CDC 1999)\r\nREF: http://www.cdc.gov/hicpac/SSI/table7-8-9-10-SSI.html','en',1,'2013-07-31 01:14:03',1,'2013-07-31 15:08:50','17135FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(17136,161919,'CDC Surgical Wound Classification: “Open, fresh, accidental wounds. In addition, operations with major breaks in sterile technique (e.g., open cardiac massage) or gross spillage from the gastrointestinal tract, and incisions in which acute, nonpurulent inflammation is encountered are included in this category.” (CDC 1999) \r\nREF: http://www.cdc.gov/hicpac/SSI/table7-8-9-10-SSI.html','en',1,'2013-07-31 01:16:55',1,'2013-07-31 15:08:33','17136FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(17137,161920,'CDC Surgical Wound Classification: “Old traumatic wounds with retained devitalized tissue and those that involve existing clinical infection or perforated\r\nviscera. This definition suggests that the organisms causing postoperative infection were present in the operative field before the operation.” (CDC 1999)\r\nREF: http://www.cdc.gov/hicpac/SSI/table7-8-9-10-SSI.html','en',1,'2013-07-31 01:19:42',1,'2013-07-31 15:09:39','17137FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
