(17345,162638,'Favipiravir, also known as T-705 or Avigan, is an experimental anti-viral drug being developed by Toyama Chemical of Japan with activity against many RNA viruses. Like some other experimental antiviraldrugs (T-1105 and T-1106), it is a pyrazinecarboxamide derivative. Favipiravir is active against influenza viruses, West Nile virus, yellow fever virus, foot-and-mouth disease virus as well as other flaviviruses, arenaviruses, bunyaviruses and alpha viruses. Activity against enteroviruses is also reported.\r\n\r\nThe mechanism of its actions is thought to be related to the selective inhibition of viral RNA-dependent RNA polymerase. Favipiravir does not inhibit RNA or DNA synthesis in mammalian cells and is not toxic to them.\r\nREF: http://en.wikipedia.org/wiki/Favipiravir','en',1,'2014-10-27 18:25:12',1,'2014-10-27 18:25:37','17345FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(17346,162639,'Brincidofovir (CMX001) is an experimental antiviral drug being developed by Chimerix of Durham, NC, for the treatment of cytomegalovirus, adenovirus, smallpox, and ebolavirus infections. Brincidofovir is a prodrug of cidofovir. Conjugated to a lipid, the compound is designed to release cidofovir intracellularly, allowing for higher intracellular and lower plasma concentrations of cidofovir, effectively increasing its activity against dsDNA viruses, as well as oral bioavailability. REF: http://en.wikipedia.org/wiki/Brincidofovir','en',1,'2014-10-27 18:27:20',1,'2014-10-27 18:27:31','17346FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(17347,162640,'ZMapp is an experimental biopharmaceutical drug comprising three chimeric monoclonal antibodies under development as a treatment for Ebola virus disease. The drug was first tested in humans during the 2014 West Africa Ebola virus outbreak, but has not been subjected to a randomized controlled trial to determine its safety or its efficacy. REF: http://en.wikipedia.org/wiki/ZMapp','en',1,'2014-10-27 18:29:32',1,'2014-10-27 18:29:41','17347FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
