(17649,163250,'Bukusu is a dialect of the Masaba language spoken by the Bukusu tribe of the Luhya people of western Kenya. It is one of several ethnically Luhya dialects; however, it is more closely related to the Gisu dialect of Masaaba in eastern Uganda (and to the other Luhya dialect of Tachoni) than it is to other languages spoken by the Luhya.\r\nREF: https://en.wikipedia.org/wiki/Bukusu_dialect','en',1,'2016-02-16 22:01:28',1,NULL,'17649FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(17650,163251,'Pokomo (Kipfokomo) is a Bantu language spoken primarily along the East African coast near Tana River in the Tana River District by the Pokomo people of Kenya. Kipfokomo language originated from \"Kingozi\" the language, which Kiswahili was built from. \"Kingozi\" language is the precursor of Kiswahili. Pokomos are the only tribe in the world that speak \"Kingozi\" and sometimes are referred to as wangozi because they used to wear skins (Ngozi). All adult speakers of Pokomo are bilingual in Swahili, East Africa''s lingua franca.\r\nREF: https://en.wikipedia.org/wiki/Pokomo_language','en',1,'2016-02-16 22:02:39',1,'2016-02-16 22:03:25','17650FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
