(17652,163254,'Digo (Chidigo) is a Bantu language spoken primarily along the East African coast between Mombasa and Tanga by the Digo people of Kenya and Tanzania.\r\nREF: https://en.wikipedia.org/wiki/Digo_language','en',1,'2016-02-16 22:08:17',1,NULL,'17652FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
